import Header from "./components/Header/Header";
import useMousePosition from "./utils/useMousePosition/useMousePosition";
import { motion } from "framer-motion"


function App() {

  const {x, y} = useMousePosition();
  console.log(x, y)


  return (
    <div className="App">
      <Cursor/>


      {/* <motion.div
